Property.Value:
CREATE PROCEDURE [dbo].[proc_db_tableusage]
  @nameFilter sysname = null
AS

BEGIN
-- hasbytes calculated column for ease of detecting row changes UPDATE staging.tab_property SET propertyHashKey = HASHBYTES ('MD5' , ISNULL(thumbnailUrl, 'NA') + '|' + ISNULL(externalURL, 'NA') + '|' + ISNULL([description], 'NA') + '|' + ISNULL(name, 'NA') + '|' + ISNULL(regionName, 'NA') + '|' + ISNULL(typeOfProperty, 'NA') + '|' + ISNULL(postcode, 'NA') + '|' + ISNULL(CAST(regionId AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(cityId AS NVARCHAR), 'NA') + '|' + ISNULL(cityName, 'NA') + '|' + ISNULL(stateName, 'NA') + '|' + ISNULL(countryCode, 'NA') + '|' + ISNULL(CAST(latitude AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(longitude AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(checkInFrom AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(checkOutBefore AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(sizeOfSpaceInSqm AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(sizeOfSpaceInSqft AS NVARCHAR), 'NA') + '|' + ISNULL(cancellationPolicy, 'NA') + '|' + ISNULL(CAST(minimumPricePerNight AS NVARCHAR), 'NA') + '|' + ISNULL(currencyCode, 'NA') + '|' + ISNULL(CAST(numberOfProperBedrooms AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(numberOfBathrooms AS NVARCHAR), 'NA') + '|' + ISNULL([floor], 'NA') + '|' + ISNULL(CAST(reviewsCount AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(averageRating AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(maximumNumberOfPeople AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(numberOfOtherRoomsWhereGuestsCanSleep AS NVARCHAR), 'NA') + '|' + ISNULL(CAST(minimumDaysOfStay AS NVARCHAR), 'NA') );
--aggregate checksum for the amenities UPDATE p SET amenitiesChecksum = ISNULL(agg.amenitiesChecksum, 0) FROM staging.tab_property p LEFT OUTER JOIN ( SELECT sourceId, externalId , amenitiesChecksum = ISNULL(CAST(CHECKSUM_AGG(CHECKSUM(ISNULL(amenityId, 0))) AS BIGINT), 0) FROM staging.tab_property2amenity p2a GROUP BY sourceId, externalId ) agg ON agg.sourceId = p.sourceId AND agg.externalId = p.externalId;
--aggregate checksum for the photos UPDATE p SET photosChecksum = ISNULL(agg.photosChecksum, 0) FROM staging.tab_property p LEFT OUTER JOIN ( SELECT sourceId, externalId , photosChecksum = ISNULL(CAST(CHECKSUM_AGG(ISNULL(position, -1)) AS BIGINT), 0) + ISNULL(CAST(CHECKSUM_AGG(CHECKSUM(ISNULL(url, 'NA'))) AS BIGINT), 0) FROM staging.tab_photo GROUP BY sourceId, externalId ) agg ON agg.sourceId = p.sourceId AND agg.externalId = p.externalId;
--aggregate checksum for the rates UPDATE p SET ratesChecksum = ISNULL(agg.ratesChecksum, 0) FROM staging.tab_property p LEFT OUTER JOIN ( SELECT sourceId, externalId , ratesChecksum = ISNULL(CAST(CHECKSUM_AGG(CHECKSUM(ISNULL(periodType, 'NA'))) AS BIGINT), 0) + ISNULL(CAST(CHECKSUM_AGG(CHECKSUM(ISNULL([from], 0))) AS BIGINT), 0) + ISNULL(CAST(CHECKSUM_AGG(CHECKSUM(ISNULL([to], 0))) AS BIGINT), 0) + ISNULL(CAST(CHECKSUM_AGG(CHECKSUM(ISNULL(currencyCode, 'NA'))) AS BIGINT), 0) FROM staging.tab_rate GROUP BY sourceId, externalId ) agg ON agg.sourceId = p.sourceId AND agg.externalId = p.externalId;
END

BEGIN DECLARE @rowcount INT, @message VARCHAR(255)
--first insert any new amenities --using merge instead of simple insert to to capture output into change table MERGE INTO holidayHomes.tab_amenity AS am USING staging.tab_amenity as stg_am ON stg_am.amenityId = am.amenityId WHEN NOT MATCHED BY TARGET THEN INSERT (amenityId, amenityValue) VALUES (stg_am.amenityId, stg_am.amenityValue) OUTPUT @runId, $action, INSERTED.amenityId INTO changeControl.tab_amenity_change (runId, [action], amenityId);
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info', messageContent = 'tab_amenity INSERT:' + LTRIM(STR(@@ROWCOUNT))
--now insert new property2amenity records --using merge instead of simple insert to to capture output into change table MERGE INTO holidayHomes.tab_property2amenity AS p2a USING ( SELECT @runId, new.[action], new.propertyId, imp2a.amenityId FROM changeControl.tab_property_change new INNER JOIN staging.tab_property2amenity imp2a ON imp2a.sourceId = new.sourceId AND imp2a.externalId = new.externalId WHERE new.runId = @runId AND new.[action] = 'INSERT' ) as stg_p2a (runId, [action], propertyId, amenityId) ON stg_p2a.propertyId = p2a.propertyId AND stg_p2a.amenityId = p2a.amenityId WHEN NOT MATCHED BY TARGET THEN INSERT (propertyId, amenityId, runId) VALUES (stg_p2a.propertyId, stg_p2a.amenityId, stg_p2a.runId) OUTPUT @runId, $action, INSERTED.propertyId, INSERTED.amenityId INTO changeControl.tab_property2amenity_change (runId, [action], propertyId, amenityId);
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info', messageContent = 'tab_property2amenity INSERT:' + LTRIM(STR(@@ROWCOUNT))
----------------------- --now for the amenity updates -- amenities persist, so simplest to delete existing and add new records to tab_property2amenity
-- table to capture list of properties with changed amenities DECLARE @tmp_property_changedAmenities TABLE ([action] NVARCHAR(10), sourceId INT NOT NULL, propertyId BIGINT NOT NULL, externalId BIGINT NOT NULL);
--update checksums for existing properties and output list into above table MERGE INTO holidayHomes.tab_property AS p USING ( SELECT sourceId, externalId, amenitiesChecksum FROM staging.tab_property ) AS stg ON stg.sourceId = p.sourceId AND stg.externalId = p.externalId AND stg.amenitiesChecksum <> p.amenitiesChecksum WHEN MATCHED THEN UPDATE SET amenitiesChecksum = stg.amenitiesChecksum OUTPUT $action, stg.sourceId, DELETED.propertyId, stg.externalId INTO @tmp_property_changedAmenities ([action], sourceId, propertyId, externalId);
-- capture tab_property changes for deployment, unless already there, hence merge MERGE INTO changeControl.tab_property_change AS pc USING @tmp_property_changedAmenities chg ON pc.runId = @runId AND chg.propertyId = pc.propertyId WHEN NOT MATCHED THEN INSERT (runId, [action], sourceId, propertyId, externalId) VALUES ( @runId, [action], sourceId, propertyId, externalId );
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info' , messageContent = 'tab_property Amenities Changed:' + LTRIM(STR(COUNT(1))) FROM @tmp_property_changedAmenities;
--merge new mappings with existing records (isolated with CTE) -- capture changes in holidayHomes.tab_property2amenity_change for deployment WITH p2a AS ( SELECT p2a.propertyId, p2a.amenityId, p2a.runId FROM holidayHomes.tab_property2amenity p2a INNER JOIN @tmp_property_changedAmenities chg ON chg.propertyId = p2a.propertyId ) MERGE INTO p2a USING ( SELECT chg.propertyId, stg2a.amenityId, stg2a.runId FROM @tmp_property_changedAmenities chg INNER JOIN staging.tab_property2amenity stg2a ON stg2a.sourceId = chg.sourceId AND stg2a.externalId = chg.externalId ) AS stg (propertyId, amenityId, runId) ON stg.propertyId = p2a.propertyId AND stg.amenityId = p2a.amenityId WHEN NOT MATCHED BY TARGET THEN INSERT (propertyId, amenityId, runId) VALUES (stg.propertyId, stg.amenityId, stg.runId) WHEN NOT MATCHED BY SOURCE THEN DELETE OUTPUT @runId, $action, ISNULL(INSERTED.propertyId, DELETED.propertyId), ISNULL(INSERTED.amenityId, DELETED.amenityId) INTO changeControl.tab_property2amenity_change (runId, [action], propertyId, amenityId); END

BEGIN DECLARE @rowcount INT, @message VARCHAR(255)
--insert new photo records --using merge instead of simple insert to to capture output into change table MERGE INTO holidayHomes.tab_photo AS ph USING ( SELECT new.propertyId, ph.position, ph.url, ph.runId FROM changeControl.tab_property_change new INNER JOIN staging.tab_photo ph ON ph.sourceId = new.sourceId AND ph.externalId = new.externalId WHERE new.runId = @runId AND new.[action] = 'INSERT' ) as stg_ph ON stg_ph.propertyId = ph.propertyId AND stg_ph.position = ph.position AND stg_ph.url = ph.url WHEN NOT MATCHED BY TARGET THEN INSERT (propertyId, position, url, runId) VALUES (stg_ph.propertyId, stg_ph.position, stg_ph.url, stg_ph.runId) OUTPUT @runId, $action, INSERTED.photoId, INSERTED.propertyId INTO changeControl.tab_photo_change (runId, [action], photoId, propertyId);
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info', messageContent = 'tab_photo INSERT:' + LTRIM(STR(@@ROWCOUNT))
-- table to capture list of properties with changed photos DECLARE @tmp_property_changedPhotos TABLE ([action] NVARCHAR(10), sourceId INT NOT NULL, propertyId BIGINT NOT NULL, externalId BIGINT NOT NULL);
--update checksums for existing properties and output list into above table MERGE INTO holidayHomes.tab_property AS p USING ( SELECT sourceId, externalId, photosChecksum FROM staging.tab_property ) AS imp ON imp.sourceId = p.sourceId AND imp.externalId = p.externalId AND imp.photosChecksum <> p.photosChecksum WHEN MATCHED THEN UPDATE SET photosChecksum = imp.photosChecksum OUTPUT $action, DELETED.propertyId, imp.sourceId, imp.externalId INTO @tmp_property_changedphotos ([action], propertyId, sourceId, externalId);
-- capture tab_property changes for deployment, unless already there, hence merge MERGE INTO changeControl.tab_property_change AS pc USING @tmp_property_changedphotos chg ON pc.runId = @runId AND chg.propertyId = pc.propertyId WHEN NOT MATCHED THEN INSERT (runId, [action], sourceId, propertyId, externalId) VALUES ( @runId, [action], sourceId, propertyId, externalId );
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info' , messageContent = 'tab_property Photos Changed:' + LTRIM(STR(COUNT(1))) FROM @tmp_property_changedphotos;
--merge new mappings with existing records (isolated with CTE) -- capture changes in changeControl.tab_photo_change for deployment WITH ph AS ( SELECT ph.photoId, ph.propertyId, ph.position, ph.url, ph.runId FROM holidayHomes.tab_photo ph INNER JOIN @tmp_property_changedPhotos chg ON chg.propertyId = ph.propertyId ) MERGE INTO ph USING ( SELECT chg.propertyId, stgph.position, stgph.url, stgph.runId FROM @tmp_property_changedPhotos chg INNER JOIN staging.tab_photo stgph ON stgph.sourceId = chg.sourceId AND stgph.externalId = chg.externalId ) AS stg (propertyId, position, url, runId) ON stg.propertyId = ph.propertyId AND stg.position = ph.position AND stg.url = ph.url WHEN NOT MATCHED BY TARGET THEN INSERT (propertyId, position, url, runId) VALUES (stg.propertyId, stg.position, stg.url, stg.runId) WHEN NOT MATCHED BY SOURCE THEN DELETE OUTPUT @runId, $action, ISNULL(INSERTED.photoId, DELETED.photoId), ISNULL(INSERTED.propertyId, DELETED.propertyId) INTO changeControl.tab_photo_change (runId, [action], photoId, propertyId);
END

BEGIN DECLARE @rowcount INT, @message VARCHAR(255)
--capture affected sources to restrict merge queries DECLARE @tmp_stagingSource TABLE (sourceId INT NOT NULL PRIMARY KEY)
INSERT @tmp_stagingSource (sourceId) SELECT DISTINCT sourceId FROM staging.tab_property;
--use CTE to restrict target records to jsut the source we are dealing with WITH prop AS ( SELECT prop.propertyId, prop.sourceId, prop.runId, prop.externalId, prop.thumbnailUrl, prop.externalURL, prop.[description], prop.name, prop.regionName, prop.typeOfProperty, prop.postcode, prop.regionId, prop.cityId , prop.cityName, prop.countryCode, prop.latitude, prop.longitude, prop.checkInFrom, prop.checkOutBefore, prop.sizeOfSpaceInSqm, prop.sizeOfSpaceInSqft, prop.cancellationPolicy , prop.minimumPricePerNight, prop.currencyCode, prop.numberOfProperBedrooms, prop.numberOfBathrooms, prop.[floor], prop.reviewsCount, prop.averageRating , prop.maximumNumberOfPeople, prop.numberOfOtherRoomsWhereGuestsCanSleep, prop.minimumDaysOfStay, prop.dateCreated, prop.lastUpdated , prop.propertyHashKey, prop.amenitiesChecksum, prop.photosChecksum, prop.ratesChecksum FROM holidayHomes.tab_property prop INNER JOIN @tmp_stagingSource src on src.sourceId = prop.sourceId ) MERGE INTO prop USING ( SELECT sourceId, runId, externalId, thumbnailUrl, externalURL, [description], name, regionName, typeOfProperty, postcode, regionId, cityId , cityName, countryCode, latitude, longitude, checkInFrom, checkOutBefore, sizeOfSpaceInSqm, sizeOfSpaceInSqft, cancellationPolicy , minimumPricePerNight, currencyCode, numberOfProperBedrooms, numberOfBathrooms, [floor], reviewsCount, averageRating , maximumNumberOfPeople, numberOfOtherRoomsWhereGuestsCanSleep, minimumDaysOfStay, propertyHashKey, amenitiesChecksum, photosChecksum, ratesChecksum FROM staging.tab_property ) AS src (sourceId, runId, externalId, thumbnailUrl, externalURL, [description], name, regionName, typeOfProperty, postcode, regionId, cityId , cityName, countryCode, latitude, longitude, checkInFrom, checkOutBefore, sizeOfSpaceInSqm, sizeOfSpaceInSqft, cancellationPolicy , minimumPricePerNight, currencyCode, numberOfProperBedrooms, numberOfBathrooms, [floor], reviewsCount, averageRating , maximumNumberOfPeople, numberOfOtherRoomsWhereGuestsCanSleep, minimumDaysOfStay, propertyHashKey, amenitiesChecksum, photosChecksum, ratesChecksum ) ON (src.sourceId = prop.sourceId AND src.externalId = prop.externalId ) -- exists but different, so update details WHEN MATCHED AND src.propertyHashKey <> prop.propertyHashKey THEN UPDATE SET sourceId = src.sourceId , runId = src.runId , thumbnailUrl = src.thumbnailUrl , externalURL = src.externalURL , [description] = src.[description] , name = src.name , regionName = src.regionName , typeOfProperty = src.typeOfProperty , postcode = src.postcode , regionId = src.regionId , cityId = src.cityId , cityName = src.cityName , countryCode = src.countryCode , latitude = src.latitude , longitude = src.longitude , checkInFrom = src.checkInFrom , checkOutBefore = src.checkOutBefore , sizeOfSpaceInSqm = src.sizeOfSpaceInSqm , sizeOfSpaceInSqft = src.sizeOfSpaceInSqft , cancellationPolicy = src.cancellationPolicy , minimumPricePerNight = src.minimumPricePerNight , currencyCode = src.currencyCode , numberOfProperBedrooms = src.numberOfProperBedrooms , numberOfBathrooms = src.numberOfBathrooms , [floor] = src.[floor] , reviewsCount = src.reviewsCount , averageRating = src.averageRating , maximumNumberOfPeople = src.maximumNumberOfPeople , numberOfOtherRoomsWhereGuestsCanSleep = src.numberOfOtherRoomsWhereGuestsCanSleep , minimumDaysOfStay = src.minimumDaysOfStay , propertyHashKey = src.propertyHashKey , lastUpdated = GETDATE() -- don't want to update these yet, they'll be set by the relevant merge procs.. --, amenitiesChecksum = src.amenitiesChecksum --, photosChecksum = src.photosChecksum --, ratesChecksum = src.ratesChecksum
-- DNE, so insert WHEN NOT MATCHED BY TARGET THEN INSERT (sourceId, runId, externalId, thumbnailUrl, externalURL, [description], name, regionName, typeOfProperty, postcode, regionId, cityId , cityName, countryCode, latitude, longitude, checkInFrom, checkOutBefore, sizeOfSpaceInSqm, sizeOfSpaceInSqft, cancellationPolicy , minimumPricePerNight, currencyCode, numberOfProperBedrooms, numberOfBathrooms, [floor], reviewsCount, averageRating , maximumNumberOfPeople, numberOfOtherRoomsWhereGuestsCanSleep, minimumDaysOfStay, propertyHashKey, amenitiesChecksum, photosChecksum, ratesChecksum ) VALUES (src.sourceId, src.runId, src.externalId, src.thumbnailUrl, src.externalURL, src.[description], src.name, src.regionName, src.typeOfProperty, src.postcode, src.regionId, src.cityId , src.cityName, src.countryCode, src.latitude, src.longitude, src.checkInFrom, src.checkOutBefore, src.sizeOfSpaceInSqm, src.sizeOfSpaceInSqft, src.cancellationPolicy , src.minimumPricePerNight, src.currencyCode, src.numberOfProperBedrooms, src.numberOfBathrooms, src.[floor], src.reviewsCount, src.averageRating , src.maximumNumberOfPeople, src.numberOfOtherRoomsWhereGuestsCanSleep, src.minimumDaysOfStay, src.propertyHashKey, src.amenitiesChecksum, src.photosChecksum, src.ratesChecksum )
-- not in live table, so delete WHEN NOT MATCHED BY SOURCE THEN DELETE
-- capture changes for deployment and so can insert amenities and photos (below) OUTPUT @runId, $action, ISNULL(INSERTED.sourceId, DELETED.sourceId), ISNULL(INSERTED.propertyId, DELETED.propertyId), ISNULL(INSERTED.externalId, DELETED.externalId) INTO changeControl.tab_property_change (runId, [action], sourceId, propertyId, externalId);
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info' , messageContent = 'tab_property ' + [action] + ':' + LTRIM(STR(COUNT(1))) FROM changeControl.tab_property_change WHERE runId = @runId GROUP BY [action];
END

BEGIN DECLARE @rowcount INT, @message VARCHAR(255)
--insert new rate records --using merge instead of simple insert to to capture output into change table MERGE INTO holidayHomes.tab_rate AS r USING ( SELECT new.propertyId , r.periodType , r.[from] , r.[to] , r.[currencyCode] , r.runId FROM changeControl.tab_property_change new INNER JOIN staging.tab_rate r ON r.sourceId = new.sourceId AND r.externalId = new.externalId WHERE new.runId = @runId AND new.[action] = 'INSERT' ) as stg_r ON stg_r.propertyId = r.propertyId AND stg_r.periodType = r.periodType AND stg_r.[from] = r.[from] AND stg_r.[to] = r.[to] AND stg_r.[currencyCode] = r.[currencyCode] WHEN NOT MATCHED BY TARGET THEN INSERT (propertyId, periodType, [from], [to], [currencyCode], runId) VALUES (stg_r.propertyId, stg_r.periodType, stg_r.[from], stg_r.[to], stg_r.[currencyCode], stg_r.runId) OUTPUT @runId, $action, INSERTED.rateId, INSERTED.propertyId INTO changeControl.tab_rate_change (runId, [action], rateId, propertyId);
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info', messageContent = 'tab_rate INSERT:' + LTRIM(STR(@@ROWCOUNT))
-- table to capture list of properties with changed rates DECLARE @tmp_property_changedrates TABLE ([action] NVARCHAR(10), sourceId INT NOT NULL, propertyId BIGINT NOT NULL, externalId BIGINT NOT NULL);
--update checksums for existing properties and output list into above table MERGE INTO holidayHomes.tab_property AS p USING ( SELECT sourceId, externalId, ratesChecksum FROM staging.tab_property ) AS imp ON imp.sourceId = p.sourceId AND imp.externalId = p.externalId AND imp.ratesChecksum <> p.ratesChecksum WHEN MATCHED THEN UPDATE SET ratesChecksum = imp.ratesChecksum OUTPUT $action, DELETED.propertyId, imp.sourceId, imp.externalId INTO @tmp_property_changedrates ([action], propertyId, sourceId, externalId);
-- capture tab_property changes for deployment, unless already there, hence merge MERGE INTO changeControl.tab_property_change AS pc USING @tmp_property_changedrates chg ON pc.runId = @runId AND chg.propertyId = pc.propertyId WHEN NOT MATCHED THEN INSERT (runId, [action], sourceId, propertyId, externalId) VALUES ( @runId, [action], sourceId, propertyId, externalId );
-- log counts INSERT import.tab_runLog ( runId, messageType, messageContent) SELECT @runId, 'info' , messageContent = 'tab_property rates Changed:' + LTRIM(STR(COUNT(1))) FROM @tmp_property_changedrates;
--merge new mappings with existing records (isolated with CTE) -- capture changes in changeControl.tab_rate_change for deployment WITH r AS ( SELECT r.rateId, r.propertyId, r.periodType, r.[from], r.[to], r.[currencyCode], r.runId FROM holidayHomes.tab_rate r INNER JOIN @tmp_property_changedrates chg ON chg.propertyId = r.propertyId ) MERGE INTO r USING ( SELECT chg.propertyId, stg_r.periodType, stg_r.[from], stg_r.[to], stg_r.[currencyCode], stg_r.runId FROM @tmp_property_changedrates chg INNER JOIN staging.tab_rate stg_r ON stg_r.sourceId = chg.sourceId AND stg_r.externalId = chg.externalId ) AS stg (propertyId, periodType, [from], [to], [currencyCode], runId) ON stg.propertyId = r.propertyId AND stg.periodType = r.periodType AND stg.[from] = r.[from] AND stg.[to] = r.[to] AND stg.[currencyCode] = r.[currencyCode] WHEN NOT MATCHED BY TARGET THEN INSERT (propertyId, periodType, [from], [to], [currencyCode], runId) VALUES (stg.propertyId, stg.periodType, stg.[from], stg.[to], stg.[currencyCode], stg.runId) WHEN NOT MATCHED BY SOURCE THEN DELETE OUTPUT @runId, $action, ISNULL(INSERTED.propertyId, DELETED.propertyId), ISNULL(INSERTED.rateId, DELETED.rateId) INTO changeControl.tab_rate_change (runId, [action], propertyId, rateId);
END

BEGIN
-- The recursive CTE is expensive, so count floors, do simple insert then restrict CTE concat DECLARE @tmp_floorCount TABLE ( sourceId INT , runId INT , fileId INT , basic_information_id INT , floors_id INT , floorCount INT );
INSERT @tmp_floorCount ( sourceId, runId, fileId, basic_information_id, floors_id, floorCount ) SELECT bi2f.sourceId , bi2f.runId , bi2f.fileId , bi2f.basic_information_id , bi2f.floors_id , floorCount = count(f.floors_id) FROM waytostay.imp_floors bi2f LEFT OUTER JOIN waytostay.imp_floor f ON f.runId = bi2f.runId AND f.fileId = bi2f.fileId AND f.floors_id = bi2f.floors_id WHERE bi2f.runId = @runId AND bi2f.fileId = @fileId GROUP BY bi2f.sourceId, bi2f.runId, bi2f.fileId, bi2f.basic_information_id, bi2f.floors_id;
-- insert the single floor entries first INSERT waytostay.imp_concatfloors ( sourceId, runId, fileId, basic_information_id, concatfloors) SELECT f.sourceId, f.runId, f.fileId, fc.basic_information_id, f.[Floor] FROM @tmp_floorCount fc INNER JOIN waytostay.imp_floor f ON f.runId = fc.runId AND f.fileId = fc.fileId AND f.floors_id = fc.floors_id WHERE fc.floorCount = 1
;WITH partitioned AS ( SELECT fc.sourceId, fc.runId, fc.fileId, fc.basic_information_id, f.[floor] , ROW_NUMBER() OVER (PARTITION BY fc.basic_information_id, fc.fileId ORDER BY f.[Floor]) AS iteration , COUNT(*) OVER (PARTITION BY fc.basic_information_id, fc.fileId) AS maxRow FROM @tmp_floorCount fc INNER JOIN waytostay.imp_floor f ON f.runId = fc.runId AND f.fileId = fc.fileId AND f.floors_id = fc.floors_id WHERE fc.runId = @runId AND fc.fileId = @fileId AND fc.floorCount > 1 ), concatenated AS ( SELECT sourceId, runId, fileId, basic_information_id, CAST([floor] AS NVARCHAR(255)) AS concatFloors, [floor], iteration, maxRow FROM partitioned WHERE iteration = 1
UNION ALL
SELECT p.sourceId, p.runId, p.fileId, p.basic_information_id, CAST(c.concatFloors + ', ' + p.[floor] AS NVARCHAR(255)), p.[floor], p.iteration, p.maxRow FROM partitioned AS p INNER JOIN concatenated AS c ON c.runId = p.runId AND c.fileId = p.fileId AND c.basic_information_id = p.basic_information_id AND p.iteration = c.iteration + 1 ) INSERT waytostay.imp_concatfloors ( sourceId, runId, fileId, basic_information_id, concatfloors) SELECT sourceId, runId, fileId, basic_information_id, concatFloors FROM concatenated WHERE iteration = maxRow OPTION (MAXRECURSION 5000);
END
